import nltk
import spacy
import string
import gensim
import numpy as np
from textblob import TextBlob
from sklearn.feature_extraction.text import TfidfVectorizer
from vaderSentiment.vaderSentiment import SentimentIntensityAnalyzer
from nltk.corpus import stopwords
from nltk.tokenize import word_tokenize
from gensim import corpora, models

# Ensure NLTK resources are downloaded
nltk.download('punkt')
nltk.download('stopwords')

# Initialize SpaCy model and Sentiment Analyzer
nlp = spacy.load("en_core_web_sm")
analyzer = SentimentIntensityAnalyzer()

# Preprocessing: Tokenization, Stopword Removal, Lemmatization
def preprocess_text(text):
    # Tokenization
    tokens = word_tokenize(text.lower())

    # Remove punctuation and stopwords
    stop_words = set(stopwords.words('english'))
    tokens = [word for word in tokens if word not in stop_words and word not in string.punctuation]

    # Lemmatization
    doc = nlp(' '.join(tokens))
    lemmatized_tokens = [token.lemma_ for token in doc]

    return lemmatized_tokens

# Sentiment Analysis using VADER
def perform_sentiment_analysis(text):
    sentiment = analyzer.polarity_scores(text)
    return sentiment

# Topic Modeling using LDA
def perform_topic_modeling(corpus):
    dictionary = corpora.Dictionary(corpus)
    doc_term_matrix = [dictionary.doc2bow(doc) for doc in corpus]
    LDA = gensim.models.ldamodel.LdaModel
    lda_model = LDA(doc_term_matrix, num_topics=3, id2word=dictionary, passes=15)
    return lda_model.print_topics()

# Named Entity Recognition (NER) using SpaCy
def perform_ner(text):
    doc = nlp(text)
    entities = [(ent.text, ent.label_) for ent in doc.ents]
    return entities

# Skills Extraction using TF-IDF
def extract_skills(text, top_n=10):
    vectorizer = TfidfVectorizer(stop_words='english', max_features=top_n)
    tfidf_matrix = vectorizer.fit_transform([text])
    feature_names = vectorizer.get_feature_names_out()
    return feature_names

# Text Summarization using TextBlob (Basic Extractive Summarization)
def summarize_text(text, sentence_count=3):
    blob = TextBlob(text)
    sentences = blob.sentences
    sorted_sentences = sorted(sentences, key=lambda s: len(s), reverse=True)
    return ' '.join([str(sentence) for sentence in sorted_sentences[:sentence_count]])

# Apply NLP techniques to each candidate's transcript
def analyze_candidate(candidate_id, transcript):
    print(f"\n--- Analyzing Candidate {candidate_id} ---\n")

    # 1. Preprocessing
    processed_text = preprocess_text(transcript)
    print(f"Processed Tokens: {processed_text[:10]}...")

    # 2. Sentiment Analysis
    sentiment = perform_sentiment_analysis(transcript)
    print(f"Sentiment Analysis: {sentiment}")

    # 3. Topic Modeling
    lda_topics = perform_topic_modeling([processed_text])
    print(f"Topics: {lda_topics}")

    # 4. Named Entity Recognition (NER)
    ner_entities = perform_ner(transcript)
    print(f"Named Entities: {ner_entities}")

    # 5. Skills Extraction
    skills = extract_skills(transcript)
    print(f"Extracted Skills: {skills}")

    # 6. Text Summarization
    summary = summarize_text(transcript)
    print(f"Summary: {summary}")

    # Flatten or convert complex structures into strings
    lda_topics_str = ', '.join([str(topic) for topic in lda_topics])
    ner_entities_str = ', '.join([f"{entity}: {label}" for entity, label in ner_entities])
    skills_str = ', '.join(skills)

    # Create a DataFrame for the candidate
    candidate_data = {
        'candidate_id': candidate_id,
        'processed_text': ' '.join(processed_text),  # Joining tokens back into a string
        'sentiment': sentiment,
        'lda_topics': lda_topics_str,
        'ner_entities': ner_entities_str,
        'skills': skills_str,
        'summary': summary
    }

    # Create the DataFrame (only one row per candidate)
    candidate_df = pd.DataFrame([candidate_data])

    # Save the DataFrame to a CSV file
    candidate_df.to_csv(f"candidate_{candidate_id}.csv", index=False)

    return candidate_df


combined_candidate_df=pd.DataFrame()
# Example: assuming transcripts are numbered from 1 to 10
for candidate_id in range(1, candidates+1):
    candidate_df= analyze_candidate(candidate_id, transcript[candidate_id])
    combined_candidate_df=pd.concat([combined_candidate_df,candidate_df],axis=0)

