def get_response(transcript):
    # Create the messages list with a system prompt
    messages = [
        {"role": "system", "content": "You are a seasoned interviewer."},
        {"role": "user", "content": f'''
            Please analyze the following transcript with the following objectives:

            1. **Role Fit**: Determine the most suitable role for the candidate based on their responses and experience.
            2. **Technical Knowledge**: Assess the candidate's technical knowledge and expertise relevant to the potential role.
            3. **Communication Analysis**: Evaluate how the candidate conveys their thoughts, including clarity, confidence, and articulation.
            4. **Emotional and Personality Insights**: Analyze the emotional tone and personality traits reflected in the candidate's speech. Consider factors such as enthusiasm, confidence, and demeanor.
            5. **Hiring Decision**: Based on the analysis, provide a recommendation on whether the candidate should be hired for the role, including justifications for your decision.

            Transcript: {transcript}

            Please format your response as a dictionary with the following keys:
            - "Role Fit"
            - "Technical Knowledge"
            - "Communication Analysis"
            - "Emotional and Personality Insights"
            - "Hiring Decision"
        '''}
    ]

    # Generate the response from the model
    response = openai.chat.completions.create(
        model="gpt-4",  # Specify the model you want to use
        messages=messages
    )

    # Extract the reply
    reply = response.choices[0].message.content
    return reply

