import re

def extract_objective_text(text, objective):
    # Use regex to find the text following the objective and ending before the next one
    pattern = re.compile(rf'"{objective}":\s*"(.*?)"', re.DOTALL)
    match = pattern.search(text)
    if match:
        return match.group(1).strip()  # Return the matched text and strip any extra spaces
    return None  # Return None if no match is found


