from vaderSentiment.vaderSentiment import SentimentIntensityAnalyzer

# Initialize SentimentIntensityAnalyzer
analyzer = SentimentIntensityAnalyzer()

# Function to calculate sentiment score for a given text
def get_sentiment_score(text):
    sentiment = analyzer.polarity_scores(text)
    return sentiment['compound']  # 'compound' gives the overall sentiment score

# Apply the sentiment scoring to each relevant column
columns_to_score = ['Role Fit', 'Technical Knowledge', 'Communication Analysis', 'Emotional and Personality Insights', 'Hiring Decision']

# Create a new DataFrame to store the scores
scores_df = pd.DataFrame()

# Generate sentiment scores for each column and add to scores_df
for column in columns_to_score:
    scores_df[column + '_Score'] = response_df_split[column].apply(get_sentiment_score)

# Concatenate the scores with the original dataframe
response_with_scores = pd.concat([response_df_split, scores_df], axis=1)

for idx,row in response_with_scores.iterrows():

    columns_to_score = ['Role Fit', 'Technical Knowledge', 'Communication Analysis', 'Emotional and Personality Insights', 'Hiring Decision']
    cumulative_score=0
    for col in columns_to_score:
        score=row[col+'_Score']
        cumulative_score+=score
    response_with_scores.loc[idx,'Overall_Score']=cumulative_score

response_with_scores

response_with_scores.to_csv("gpt_response_with_scores.csv",index=False)

